import React, { useState } from "react";

const Checkbox = ({name, checked, changeCheckState}) => {


  return (
    <div>
    <input type="checkbox" checked = {checked} onChange = {changeCheckState}/>
    <label>{name}</label>
    </div>
  );
};

export default Checkbox;
